import React, { useState, useEffect, Fragment } from "react";
import axios from "axios";

function App() {
  const [data, setData] = useState({ data: [] });
  const [changes, setChanges] = useState("2019-11-28");
  const [url, setUrl] = useState(
    `https://api.coindesk.com/v1/bpi/historical/close.json?start=2019-11-28-01&end=2019-12-13`
  );
  //`https://api.coindesk.com/v1/bpi/historical/close.json?start=${chages}-01&end=2019-12-13`

  useEffect(() => {
    const fetchData = async () => {
      const response = await axios(url);
      setData(response);
    };
    fetchData();
  }, [url]);
  console.log("object", data.data, url);
  return (
    <div>
      <h1>the new app works</h1>
      <Fragment>
        <input
          type="text"
          value={changes}
          onChange={event => setChanges(event.target.value)}
        />
        <button
          type="button"
          onClick={() =>
            setUrl(
              `https://api.coindesk.com/v1/bpi/historical/close.json?start=${changes}-01&end=2019-12-13`
            )
          }
        >
          Search
        </button>

        <ul>
          {data.data.map(item => (
            <li key={item.objectID}>{/* <a href={item.url}></a> */}</li>
          ))}
        </ul>
      </Fragment>
    </div>
  );
}

export default App;
